import "./index.css";
import { ValueCard } from "./ValueCard";

export function ValueList(values) {
  {
    console.log(values.length);
  }
  return (
    <section className="resume-container">
      <div className="resume_header flex">
        <p className="description">Resumo Financeiro</p>
        <div className="buttons-container">
          <button type="button" className="gray_button">
            Todos
          </button>
          <button type="button" className="gray_button">
            Entradas
          </button>
          <button type="button" className="gray_button">
            Despesas
          </button>
        </div>
      </div>
      <ul className="resume-list">
        {values.length ? (
          values.map((value, index) => <ValueCard key={index} value={value} />)
        ) : (
          <li className="list">
            <p>Você ainda não tem nenhum lançamento!</p>
          </li>
        )}
      </ul>
    </section>
  );
}
